INSERT INTO `tbl_FAQ` (`id`, `question1`, `answer1`, `question2`, `answer2`, `question3`, `answer3`, `question4`, `answer4`, `question5`, `answer5`, `question6`, `answer6`, `question7`, `answer7`, `question8`, `answer8`, `question9`, `answer9`, `question10`, `answer10`, `question11`, `answer11`, `question12`, `answer12`, `question13`, `answer13`, `question14`, `answer14`, `question15`, `answer15`, `question16`, `answer16`, `question17`, `answer17`, `question18`, `answer18`, `question19`, `answer19`, `question20`, `answer20`, `question21`, `answer21`, `question22`, `answer22`, `question23`, `answer23`, `question24`, `answer24`, `question25`, `answer25`, `question26`, `answer26`, `question27`, `answer27`, `question28`, `answer28`, `question29`, `answer29`, `question30`, `answer30`, `date_created`) VALUES
(1, 'What is the minimum age requirement?', '<p>The minimum age requirement for On Voyage is 18 years old. If you&rsquo;re under 18 years old and have an account, it will not be enabled.</p>\r\n', 'My messages are not going through.', '<p>This may be temporary so I would suggest trying again at a later time. Just make sure you have a strong internet connection. Should the issue remain for a proloned please contact the support team. ', 'I lost all my Trip Companions', '<p>Try logging out and logging back in. Tap the icon on the top left-hand corner of the main screen, select &#39;Settings&#39; or &#39;App Settings,&#39; scroll down and hit &#39;Logout.&#39; If the i', 'I accidentally left-swiped someone, can I get them back?', '<p>Unfortunately they have gone! However try submitting a new trip with similar search requirements and the user should appear there.</p>\r\n', 'I can’t log in.', '<p>This may be temporary so I would suggest trying again at a later time. If the issue persists, try reinstalling the app. To reinstall, just delete the app from your phone and download On Voyage agai', 'One of my Trip Companions disappeared.', '<p>It sounds like that person changed their mind or deleted their account. Try logging out and logging back in just to be sure. Tap the icon on the top left-hand corner of the main screen, select &#39', 'Sign up and login ', '<p>A. Yes you can transfer your credit limit to others e.g. your family members, staff members, friends and business associates.</p>\r\n', ' Why does On Voyage need to access my photos / camera roll?', '<p>If you want to upload profile photos directly from your phone, On Voyage needs access to your photos. If you denied On Voyage access to your photos, go to &#39;Settings&#39; on your phone, find &#3', 'The app keeps crashing.', '<p>Make sure you have the latest version and that your phone&rsquo;s operating system is up-to-date, then try force quitting the app. If the issue persists, try reinstalling the app. To reinstall, jus', 'Will I lose my matches if I delete the app?', '<p>As long as you don&#39;t delete your account, deleting the app won&#39;t delete any of your matches or messages.</p>\r\n', 'How do I change my age?', '<p>If you want to change your age on On Voyage, you&rsquo;ll have to delete your account and start over. Deleting your On Voyage account will delete all your matches and messages. If you wish to proce', 'I can’t change my settings.', '<p>Tap the top left corner and it will open the drop down menu, select &ldquo;Settings&rdquo; and adjust as you wish.</p>\r\n', 'How do I delete my account?', '<p>For security purposes, if you want to delete your account, you&rsquo;ll need to do it directly on the app. You will permanently lose your matches, messages and all other information associated with', 'Photos How do I add a profile photo?', '<p>You can upload profile photos from Facebook or from your phone directly<br />\r\n. Tap the icon on the top left-hand corner of the main screen<br />\r\n. Tap on your profile photo<br />\r\nSelect &#39;Ed', 'I can’t upload photos.', '<p>Make sure you have the latest version of KudoS. If you are having trouble uploading a photo from Facebook, make sure your pictures are in a public album or at least visible to your friends (not you', 'I accidentally denied Kudos access to my photos.', '<p>If you denied KudoS access to your photos / camera roll, go to &#39;Settings&#39; on your phone, find &#39;KudoS,&#39; and enable photo access. If you denied KudoS access to your Facebook photos: f', 'Companions (Swiping through other users) What are Companions?', '<p>Companions are the part of the app where you get to swipe through other users and hopefully get connected with other On Voyagelers!</p>\r\n', 'I accidentally left-swiped someone, can I get them back?', '<p>No, only users who you have connected with will be able to receive your messages</p>\r\n', 'Can I message someone I haven’t matched with?', '<p>Currently no, but you always submit a new trip with similar details and hopefully the same On Voyageler will show up.</p>\r\n', 'How do I report someone?', '<p>You can report users that you have already matched with, and users you haven&rsquo;t matched with. To report someone, go to their profile, hit the menu icon and hit report.</p>\r\n', ' On Voyage says “Sorry, no further travel companions found”', '<p>Tap the icon on the top left-hand corner of the main screen, select &#39;Settings&#39; or &#39;Discovery Settings&#39;, and try increasing the distance and age range. You can also try logging out a', 'On Voyage says its “Searching for travel companions” but nothing is showing.', '<p>This may be temporary, so I would suggest trying again at a later time. On your device, go to Settings and make sure the GPS (location services) is enabled. You may have to open the Maps app in ord', 'How do I disconnect someone?', '<p>TGo to his/her profile, hit the icon in the top right hand corner, and select &ldquo;Unmatch&rdquo;.</p>\r\n', 'I got a new companion notification but I don’t see the Companion.', '<p>If the chat doesn&rsquo;t come up, it means that person either unmatched you or deleted their account. There might be a slight delay so I would recommend trying again later.</p>\r\n', 'I lost all my Companions!', '<p>Try logging out and logging back in. Tap the icon on the top left-hand corner of the main screen, select &#39;Settings&#39; or &#39;App Settings&#39;, scroll down and hit &#39;Logout&#39;.</p>\r\n', 'One of my Companions disappeared.', '<p>It sounds like that person either unmatched you or deleted their account. Try logging out and logging back in just to be sure. Tap the icon on the top left-hand corner of the main screen, select &#', 'Chat I got a new message notification but I don’t see it.', '<p>If the conversation doesn&rsquo;t come up, it means that person either unmatched you or deleted their account. There might be a slight delay so I would recommend trying again later.</p>\r\n', 'Can I message someone I haven’t connected with?', '<p>No, only users who both swiped right can initiate a chat.</p>\r\n', 'My messages are not going through.', '<p>This may be temporary so I would suggest trying again at a later time. Just make sure you have a strong internet connection.</p>\r\n', 'Groups How do I start a group?', '<p>To create a group on On Voyage, just follow the steps below:<br />\r\n. Download the latest version of On Voyage<br />\r\n. Setup your profile<br />\r\n.Go to &ldquo;Add a new trip&rdquo;<br />\r\n. Select', '2017-06-06 13:24:16');
